import React from 'react';

import styles from './Person.module.css';

const person = (props) => {
    console.log("PROPS IN THE PERSON ITSELF:", props)
    return (
        <div className={styles.Person}>
            <Col xs="6" sm="4">{props.id}</Col>
            <Col xs="6" sm="4">.col-6 .col-sm-4</Col>
            <Col xs="6" sm="4">.col-sm-4</Col>
            <p>{props.id}</p>
            <p>{props.name}</p>
            <p>{props.number}</p>
        </div>
    );
}

export default person;
